import React, { useContext } from 'react';
import { Navigate, Route } from 'react-router-dom';
import { AuthContext } from '../../context/AuthContext';

const ProtectedRoute = props => {
    const {
        authState: {
            authLoading,
            isAuthenticated }
    } = useContext(AuthContext)


    if (isAuthenticated)
        return
    <Route {...props} />
};

export default ProtectedRoute;
